import React, {Component} from 'react';
import ListOfPosts from './ListOfPosts'

class App extends Component {
  constructor(props){
    super(props)

    this.state = {
      searchInput : null,
      data : null,
      isLoading : 'True'
    }
  }

  componentDidMount(){
    this.state.isLoading = 'False';
  }

  render(){
    return(
      <div>
        <ListOfPosts criteria={this.state}/> 
        Loading: {this.state.isLoading}
      </div>
    )
  }
}

export default App;
